(86, 'widget_text', 'a:7:{i:3;a:3:{s:5:"title";s:0:"";s:4:"text";s:858:"<dl class="gallery-item">\r\n<dt class="gallery-icon landscape">\r\n<a rel="gallery" class="fancybox" href="http://coloredrocks.org/wp-content/uploads/nicholas-carter.jpg"><img src="http://coloredrocks.org/wp-content/uploads/nicholas-carter-300x211.jpg" class="attachment-thumbnail" alt="Nicholas Carter" height="204" width="289"></a>\r\n</dt></dl>\r\n\r\nNicholas Carter wins Colored Rocks Prize for inspiring students to read and be responsible.\r\n\r\n<img style="margin-top:5px;" src="http://coloredrocks.org/wp-content/uploads/alduan-tartt.jpg" />\r\n\r\n"Media Personality, Author and Clinician, <a href="http://www.drtartt.com" target="_blank">Dr. Alduan Tartt</a> inspires the 2015 class of Colored Rocks."\r\n\r\n<a href="https://www.gagivesday.org/c/GGD/a/coloredrocks"><img style="margin-top:5px;" src="http://coloredrocks.org/wp-content/uploads/gives-day15.jpg" /></a>";s:6:"filter";b:0;}i:4;a:3:{s:5:"title";s:0:"";s:4:"text";s:858:"<dl class="gallery-item">\r\n<dt class="gallery-icon landscape">\r\n<a rel="gallery" class="fancybox" href="http://coloredrocks.org/wp-content/uploads/nicholas-carter.jpg"><img src="http://coloredrocks.org/wp-content/uploads/nicholas-carter-300x211.jpg" class="attachment-thumbnail" alt="Nicholas Carter" height="204" width="289"></a>\r\n</dt></dl>\r\n\r\nNicholas Carter wins Colored Rocks Prize for inspiring students to read and be responsible.\r\n\r\n<img style="margin-top:5px;" src="http://coloredrocks.org/wp-content/uploads/alduan-tartt.jpg" />\r\n\r\n"Media Personality, Author and Clinician, <a href="http://www.drtartt.com" target="_blank">Dr. Alduan Tartt</a> inspires the 2015 class of Colored Rocks."\r\n\r\n<a href="https://www.gagivesday.org/c/GGD/a/coloredrocks"><img style="margin-top:5px;" src="http://coloredrocks.org/wp-content/uploads/gives-day15.jpg" /></a>";s:6:"filter";b:0;}i:5;a:3:{s:5:"title";s:10:"Who we are";s:4:"text";s:279:"<p>The Colored Rocks Foundation is a national 501(c)(3) awarding The Colored Rocks Prize to notable male students of color who set positive examples and make worthy commitments to the success of their peers. Our goal: to improve high school graduation rates among this group.</p>";s:6:"filter";b:0;}i:6;a:3:{s:5:"title";s:32:"Register for this year''s Contest";s:4:"text";s:485:"<img src="/wp-content/themes/colored-rocks/images/register-submit.png" width="290" height="50" usemap="#m_registersubmit" alt="Register/Submit" /><map name="m_registersubmit" id="m_registersubmit">\r\n<area shape="rect" coords="150,0,290,50" href="http://coloredrocks.org/submit-your-essay/" title="Submit your essay" alt="Submit your essay" />\r\n<area shape="rect" coords="0,0,140,50" href="http://coloredrocks.org/wp-login.php?action=register" title="Register" alt="Register" />\r\n</map>";s:6:"filter";b:0;}i:7;a:3:{s:5:"title";s:16:"Login / Register";s:4:"text";s:587:"<p>You must be a male student of color to be considered for the Colored Rocks Prize.</p>\r\n\r\n<br />\r\n\r\n<img src="/wp-content/themes/colored-rocks/images/register-submit.png" width="290" height="50" usemap="#m_registersubmit" alt="Register/Submit" /><map name="m_registersubmit" id="m_registersubmit">\r\n<area shape="rect" coords="150,0,290,50" href="http://coloredrocks.org/submit-your-essay/" title="Submit your essay" alt="Submit your essay" />\r\n<area shape="rect" coords="0,0,140,50" href="http://coloredrocks.org/wp-login.php?action=register" title="Register" alt="Register" />\r\n</map>";s:6:"filter";b:0;}i:8;a:3:{s:5:"title";s:15:"Rate the Essays";s:4:"text";s:80:"Please rate the essays <a href="http://coloredrocks.org/essays/"> from here.</a>";s:6:"filter";b:0;}s:12:"_multiwidget";i:1;}', 'yes'),
