(5, 1, '2012-10-14 04:43:29', '2012-10-14 04:43:29', 'Pictured above: recipients of the 2015 Colored Rocks Prize - awarded to high-achieving senior male students from diverse ethnic backgrounds at Georgia high schools. L to R: Jason Heslup, Archie Wilson, Fahim Salewala, Noah McGee, Tyrone Holmes, Remington McCutcheon, Donovan Harris, <em>Honorary Colored Rock</em> Dr. Alduan Tartt, Devin Hall, Peter Wilborn, Kingston Handley, Isaiah Starks, Leo Malinao, Alario Harris (not pictured: Christopher Adames).\r\n<h1 style="text-align: center;"><span style="color: #99cc00;">Stories of 2015 Winners at <a title="Colored Rocks'' Stories" href="http://www.facebook.com/ColoredRocks" target="_blank">Facebook.com/ColoredRocks</a> </span></h1>\r\n<h1 style="text-align: center;"><span style="color: #99cc00;"> <span style="color: #ffcc00;"><strong>2016</strong> Competition Is Now Open - EntryDeadline 12/4/15</span></span></h1>\r\n<p style="text-align: center;"><img src="http://coloredrocks.org/wp-content/uploads/blocks-2016.png" alt="Colored Rocks" usemap="#m_blocks" width="670" height="229" /></p>\r\n<map id="m_blocks" name="m_blocks"> <area title="Register" alt="Register" coords="457,9,670,229" shape="rect" href="http://coloredrocks.org/wp-login.php?action=register" /> <area title="What is the question" alt="What is the question" coords="229,9,442,229" shape="rect" href="/question" /> <area title="About Colored Rocks" alt="About Colored Rocks" coords="0,9,213,229" shape="rect" href="/about" /> </map>\r\n\r\nAlmost <strong>one out of three young men of color do not graduate from Georgia high schools.</strong> In fact, Georgia suffers as one of 5 states with the worst high school graduation rates in the country. On the other hand, there are male students of color who do extremely well. Remember their faces. Remember their names. For they are using their talent to inspire and mold younger students. They are our future movers and shakers. They are known as Colored Rocks.\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-53" title="2015-prize-winners" src="http://coloredrocks.org/wp-content/uploads/2015-prize-winners.jpg" alt="" width="670" height="366" /></p>', 'Home Of The Colored Rocks Prize', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2015-05-03 18:55:29', '2015-05-03 18:55:29', '', 0, 'http://coloredrocks.org/?page_id=5', 14, 'page', '', 0),
