(110, 1, '2012-10-14 23:41:30', '2012-10-14 23:41:30', 'Smooth, intelligent, funny, charming and oh so wise for their years, 14 of Georgia’s own award-winning Colored Rocks share their success secrets and strategies with this collection of tips they insist helped them excel in their high school class AND in life. These likeable male senior students – all from diverse ethnic backgrounds and many from challenged upbringings – offer inspirational, yet practical tips that success seekers from all walks will find useful and engaging. Inside are full color photos of each Colored Rock, along with a snapshot of his interests and goals, and his personal secret to success. If they can do it, so can you!\r\n<p style="text-align: center;"> Success Secrets from the Inaugural Class of Colored Rocks Inside!</p>\r\n<p style="text-align: center;">This popular calendar can be yours FREE by making a minimum donation of $50 at <a title="Donate" href="http://coloredrocks.org/donate/" target="_blank">Donation Page</a>.</p>\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-133" alt="Colored Rocks Calendar" src="http://coloredrocks.org/wp-content/uploads/colored-rocks-calendar-big.jpg" width="670" height="672" /></p>', 'Get Your Colored Rocks Calendar Today', '', 'publish', 'closed', 'closed', '', 'calendar', '', '', '2013-09-25 19:06:47', '2013-09-25 19:06:47', '', 0, 'http://coloredrocks.org/?page_id=110', 6, 'page', '', 0),
