(351, 1, '2013-09-25 19:04:37', '2013-09-25 19:04:37', 'If you support the Colored Rocks Prize, Please make a donation today.\r\n\r\nIf you want to see more students from Georgia''s highest at-risk group graduating from high school instead of dropping out, hanging out and crying out, Please make a donation today.\r\n\r\n<span style="text-decoration: underline;"><strong>SUCCESS TIPS</strong></span> -- absolutely FREE! -- Every donor that makes a minimum $50 donation receives a vintage wall calendar  featuring success tips and words of wisdom from the inaugural Colored Rocks Prize Honorees (while supplies last).\r\n\r\n<iframe src="http://www.youtube.com/embed/COFa3NrhN0s?rel=0" height="503" width="670"></iframe>\r\n\r\nColored Rocks is supported by everyday folks who believe in the benefits of our mission. If you believe in our mission, invest in our award by making a contribution here.\r\n\r\n<img class="aligncenter size-full wp-image-227" alt="contribution" src="http://coloredrocks.org/wp-content/uploads/contribution.png" width="670" height="80" />\r\n<div style="float: left; width: 48%; margin-left: 28px;"><form action="https://www.paypal.com/cgi-bin/webscr" method="post"><input type="hidden" name="cmd" value="_s-xclick" />\r\n<input type="hidden" name="hosted_button_id" value="CTVBZ8MCBQY3G" />\r\n<input type="image" alt="PayPal - The safer, easier way to pay online!" name="submit" src="http://coloredrocks.org/wp-content/uploads/donation-button.png" />\r\n<img alt="" src="https://www.paypalobjects.com/en_US/i/scr/pixel.gif" width="1" height="1" border="0" /></form></div>\r\n<div style="float: left; width: 45%; padding-left: 18px;"><form action="https://www.paypal.com/cgi-bin/webscr" method="post"><input type="hidden" name="cmd" value="_s-xclick" />\r\n<input type="hidden" name="hosted_button_id" value="Y2HXJPVNZMXA8" />\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><input type="hidden" name="on0" value="Monthly Donation Amount" />Monthly Donation Amount</td>\r\n</tr>\r\n<tr>\r\n<td><select name="os0"><option value="Option 1">Option 1 : $10.00 USD - monthly</option><option value="Option 2">Option 2 : $15.00 USD - monthly</option><option value="Option 3">Option 3 : $25.00 USD - monthly</option><option value="Option 4">Option 4 : $50.00 USD - monthly</option><option value="Option 5">Option 5 : $100.00 USD - monthly</option></select></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<input type="hidden" name="currency_code" value="USD" />\r\n<input type="image" alt="PayPal - The safer, easier way to pay online!" name="submit" src="https://www.paypalobjects.com/en_US/i/btn/btn_subscribeCC_LG.gif" />\r\n<img alt="" src="https://www.paypalobjects.com/en_US/i/scr/pixel.gif" width="1" height="1" />\r\n\r\n</form></div>\r\nBy making a recurring contribution, I acknowledge that the amount I have selected above will be charged to my credit card on the 15th of every month. You may cancel at any time. The first charge will be made immediately.\r\n\r\n<strong>Contributions or gifts to The Colored Rocks Foundation are tax deductible.</strong> Please make a donation today. If you can''t make a monetary donation, please scroll down and select another way to help. We have many ways you can get involved! [si-contact-form form=''2'']', 'Donate', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2013-09-25 19:04:37', '2013-09-25 19:04:37', '', 7, 'http://coloredrocks.org/7-revision-v1/', 0, 'revision', '', 0),
(352, 1, '2013-09-25 19:06:05', '2013-09-25 19:06:05', 'Smooth, intelligent, funny, charming and oh so wise for their years, 14 of Georgia’s own award-winning Colored Rocks share their success secrets and strategies with this collection of tips they insist helped them excel in their high school class AND in life. These likeable male senior students – all from diverse ethnic backgrounds and many from challenged upbringings – offer inspirational, yet practical tips that success seekers from all walks will find useful and engaging. Inside are full color photos of each Colored Rock, along with a snapshot of his interests and goals, and his personal secret to success. If they can do it, so can you!\n<p style="text-align: center;"> Success Secrets from the Inaugural Class of Colored Rocks Inside!</p>\n<p style="text-align: center;">This popular calendar can be yours FREE by making a monthly donation of $10 at <a title="Donate" href="http://coloredrocks.org/donate/" target="_blank">Donation Page</a>.</p>\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-133" alt="Colored Rocks Calendar" src="http://coloredrocks.org/wp-content/uploads/colored-rocks-calendar-big.jpg" width="670" height="672" /></p>', 'Get Your Colored Rocks Calendar Today', '', 'inherit', 'closed', 'closed', '', '110-autosave-v1', '', '', '2013-09-25 19:06:05', '2013-09-25 19:06:05', '', 110, 'http://coloredrocks.org/110-autosave-v1/', 0, 'revision', '', 0),
(355, 1, '2013-09-25 19:08:38', '2013-09-25 19:08:38', 'Pictured above are recipients of the 2013 Colored Rocks Prize – awarded to distinguished senior male students of color attending Georgia high schools. From left: Jed Paz, Joseph Hooper, JaCorvis Cobbs, Gregory Barber, Austin Green, Brock Washington, Rashaud Archie, Isaiah Matthews, Donnie Pulliam, Tony Jones, Kalif Jones, Alex Grady, Shaun Verma, Kennington Smith and Rashad Goodson. (not pictured: Joseph Cobb)\r\n<h1 style="text-align: center;"><span style="color: #99cc00;">See Stories of 2013 Winners at Facebook.com/ColoredRocks </span></h1>\r\n<h1 style="text-align: center;"><span style="color: #99cc00;"> <span style="color: #ffcc00;"><strong>2014</strong> Competition Is Now Open - Entry Deadline 12/5/13</span></span></h1>\r\n<p style="text-align: center;"><img alt="Colored Rocks" src="http://coloredrocks.org/wp-content/uploads/blocks.png" usemap="#m_blocks" width="670" height="229" /></p>\r\n<map id="m_blocks" name="m_blocks"> <area title="Register" alt="Register" coords="457,9,670,229" shape="rect" href="http://coloredrocks.org/wp-login.php?action=register" /> <area title="What is the question" alt="What is the question" coords="229,9,442,229" shape="rect" href="/question" /> <area title="About Colored Rocks" alt="About Colored Rocks" coords="0,9,213,229" shape="rect" href="/about" /> </map>\r\n\r\nAlmost <strong>one out of three young men of color do not graduate from Georgia high schools.</strong> In fact, Georgia suffers as one of 5 states with the worst high school graduation rates in the country. On the other hand, there are male students of color who do extremely well. Remember their faces. Remember their names. For they are using their talent to inspire and help struggling students do well. They are our future movers and shakers. They are known as Colored Rocks.\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-53" title="2013-prize-winners" alt="" src="http://coloredrocks.org/wp-content/uploads/2012-prize-winners.jpg" width="670" height="366" /></p>', 'Home Of The Colored Rocks Prize', '', 'inherit', 'closed', 'closed', '', '5-revision-v1', '', '', '2013-09-25 19:08:38', '2013-09-25 19:08:38', '', 5, 'http://coloredrocks.org/5-revision-v1/', 0, 'revision', '', 0),
(356, 1, '2013-09-25 19:10:12', '2013-09-25 19:10:12', '<strong>Very Important:</strong>\r\n\r\nOnly submit your essay once. If you submit your essay more than once, you will be disqualified from the contest. You cannot edit or modify your essay after it has been submitted, so make sure that everything is correct before doing so. Give your essay a meaningful name but do NOT enter your name in the title area. Also do not include your personal information in the essay such as name or address either. If you have not read the <a title="Contest Rules" href="http://coloredrocks.org/contest-rules/">contest rules</a>, please do so now before submitting your essay.\r\n\r\nCopy your Essay from your computer and paste it in the text box below.\r\n\r\n[wpuf_addpost]', 'Submit Your Essay', '', 'inherit', 'closed', 'closed', '', '141-revision-v1', '', '', '2013-09-25 19:10:12', '2013-09-25 19:10:12', '', 141, 'http://coloredrocks.org/141-revision-v1/', 0, 'revision', '', 0),
