ocks.org/wp-content/uploads/2012-prize-winners.jpg" width="670" height="366" /></p>', 'Home Of The Colored Rocks Prize', '', 'inherit', 'closed', 'closed', '', '5-revision-v1', '', '', '2013-12-04 15:52:41', '2013-12-04 15:52:41', '', 5, 'http://coloredrocks.org/5-revision-v1/', 0, 'revision', '', 0);
