(431, 1, '2014-08-16 13:28:53', '2014-08-16 13:28:53', 'If you support the Colored Rocks Prize, Please make a donation today.\r\n\r\nIf you want to see more students from Georgia''s highest at-risk group graduating from high school instead of dropping out, hanging out and crying out, Please make a donation today.\r\n\r\n<span style="text-decoration: underline;"><strong>SUCCESS TIPS</strong></span> -- absolutely FREE! -- Every donor that makes a minimum $50 donation receives a vintage wall calendar  featuring success tips and words of wisdom from the inaugural Colored Rocks Prize Honorees (while supplies last).\r\n\r\n<iframe src="http://www.youtube.com/embed/COFa3NrhN0s?rel=0" height="503" width="670"></iframe>\r\n\r\nColored Rocks is supported by everyday folks who believe in the benefits of our mission. If you believe in our mission, invest in our award by making a contribution here.\r\n\r\n<img class="aligncenter size-full wp-image-227" alt="contribution" src="http://coloredrocks.org/wp-content/uploads/contribution.png" width="670" height="80" />\r\n<div style="float: left; width: 48%; margin-left: 28px;"><form action="https://www.paypal.com/cgi-bin/webscr" method="post"><input type="hidden" name="cmd" value="_s-xclick" />\r\n<input type="hidden" name="hosted_button_id" value="CTVBZ8MCBQY3G" />\r\n<input type="image" alt="PayPal - The safer, easier way to pay online!" name="submit" src="http://coloredrocks.org/wp-content/uploads/donation-button.png" />\r\n<img alt="" src="https://www.paypalobjects.com/en_US/i/scr/pixel.gif" width="1" height="1" border="0" /></form></div>\r\n<div style="float: left; width: 45%; padding-left: 18px;"><form action="https://www.paypal.com/cgi-bin/webscr" method="post"><input type="hidden" name="cmd" value="_s-xclick" />\r\n<input type="hidden" name="hosted_button_id" value="Y2HXJPVNZMXA8" />\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><input type="hidden" name="on0" value="Monthly Donation Amount" />Monthly Donation Amount</td>\r\n</tr>\r\n<tr>\r\n<td><select name="os0"><option value="Option 1">Option 1 : $10.00 USD - monthly</option><option value="Option 2">Option 2 : $15.00 USD - monthly</option><option value="Option 3">Option 3 : $25.00 USD - monthly</option><option value="Option 4">Option 4 : $50.00 USD - monthly</option><option value="Option 5">Option 5 : $100.00 USD - monthly</option></select></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<input type="hidden" name="currency_code" value="USD" />\r\n<input type="image" alt="PayPal - The safer, easier way to pay online!" name="submit" src="https://www.paypalobjects.com/en_US/i/btn/btn_subscribeCC_LG.gif" />\r\n<img alt="" src="https://www.paypalobjects.com/en_US/i/scr/pixel.gif" width="1" height="1" />\r\n\r\n</form></div>\r\nBy making a recurring contribution, I acknowledge that the amount I have selected above will be charged to my credit card on the 15th of every month. You may cancel at any time. The first charge will be made immediately.\r\n\r\n<strong>Contributions or gifts to The Colored Rocks Foundation are tax deductible.</strong> Please make a donation today. If you can''t make a monetary donation, please scroll down and select another way to help. We have many ways you can get involved! [si-contact-form form=''2'']', 'Donate_bak', '', 'publish', 'closed', 'closed', '', 'donate_bak', '', '', '2014-08-16 13:28:53', '2014-08-16 13:28:53', '', 0, 'http://coloredrocks.org/?page_id=431', 3, 'page', '', 0),
