(426, 1, '2015-04-27 17:57:03', '2015-04-27 17:57:03', 'Pictured above: recipients of the 2015 Colored Rocks Prize - awarded to high-achieving senior male students from diverse ethnic backgrounds at Georgia high schools. L to R: Jason Heslup, Archie Wilson, Fahim Salewala, Noah McGee, Tyrone Holmes, Remington McCutcheon, Donovan Harris, <em>Honorary Colored Rock</em> Dr. Alduan Tartt, Devin Hall, Peter Wilborn, Kingston Handley, Isaiah Starks, Leo Malinao, Alario Harris (not pictured: Christopher Adames).\n<h1 style="text-align: center;"><span style="color: #99cc00;">Stories of 2015 Winners at <a title="Colored Rocks'' Stories" href="http://www.facebook.com/ColoredRocks" target="_blank">Facebook.com/ColoredRocks</a> </span></h1>\n<h1 style="text-align: center;"><span style="color: #99cc00;"> <span style="color: #ffcc00;"><strong>2016</strong> Competition Is Now Open - EntryDeadline 12/4/15</span></span></h1>\n<p style="text-align: center;"><img src="http://coloredrocks.org/wp-content/uploads/blocks.png" alt="Colored Rocks" usemap="#m_blocks" width="670" height="229" /></p>\n<map id="m_blocks" name="m_blocks"> <area title="Register" alt="Register" coords="457,9,670,229" shape="rect" href="http://coloredrocks.org/wp-login.php?action=register" /> <area title="What is the question" alt="What is the question" coords="229,9,442,229" shape="rect" href="/question" /> <area title="About Colored Rocks" alt="About Colored Rocks" coords="0,9,213,229" shape="rect" href="/about" /> </map>\n\nAlmost <strong>one out of three young men of color do not graduate from Georgia high schools.</strong> In fact, Georgia suffers as one of 5 states with the worst high school graduation rates in the country. On the other hand, there are male students of color who do extremely well. Remember their faces. Remember their names. For they are using their talent to inspire and mold younger students. They are our future movers and shakers. They are known as Colored Rocks.\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-53" title="2013-prize-winners" src="http://coloredrocks.org/wp-content/uploads/2012-prize-winners.jpg" alt="" width="670" height="366" /></p>', 'Home Of The Colored Rocks Prize', '', 'inherit', 'closed', 'closed', '', '5-autosave-v1', '', '', '2015-04-27 17:57:03', '2015-04-27 17:57:03', '', 5, 'http://coloredrocks.org/5-autosave-v1/', 0, 'revision', '', 0),
(434, 1, '2014-08-16 14:20:27', '2014-08-16 14:20:27', 'If you support the Colored Rocks Prize, Please make a donation today.\r\n\r\nIf you want to see more students from Georgia''s highest at-risk group graduating from high school instead of dropping out, hanging out and crying out, Please make a donation today.\r\n\r\n<span style="text-decoration: underline;"><strong>SUCCESS TIPS</strong></span> -- absolutely FREE! -- Every donor that makes a minimum $50 donation receives a vintage wall calendar  featuring success tips and words of wisdom from the inaugural Colored Rocks Prize Honorees (while supplies last).\r\n\r\nColored Rocks is supported by everyday folks who believe in the benefits of our mission. If you believe in our mission, invest in our award by making a contribution here.\r\n\r\n<img class="aligncenter size-full wp-image-227" alt="contribution" src="http://coloredrocks.org/wp-content/uploads/contribution.png" width="670" height="80" />\r\n<div style="float: left; width: 48%; margin-left: 28px;"><form action="https://www.paypal.com/cgi-bin/webscr" method="post"><input type="hidden" name="cmd" value="_s-xclick" />\r\n<input type="hidden" name="hosted_button_id" value="CTVBZ8MCBQY3G" />\r\n<input type="image" alt="PayPal - The safer, easier way to pay online!" name="submit" src="https://www.paypalobjects.com/en_US/i/btn/btn_donateCC_LG.gif" />\r\n<img alt="" src="https://www.paypalobjects.com/en_US/i/scr/pixel.gif" width="1" height="1" border="0" /></form></div>\r\n<div style="float: left; width: 45%; padding-left: 18px;"><form action="https://www.paypal.com/cgi-bin/webscr" method="post"><input type="hidden" name="cmd" value="_s-xclick" />\r\n<input type="hidden" name="hosted_button_id" value="Y2HXJPVNZMXA8" />\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><input type="hidden" name="on0" value="Monthly Donation Amount" />Monthly Donation Amount</td>\r\n</tr>\r\n<tr>\r\n<td><select name="os0"><option value="Option 1">Option 1 : $10.00 USD - monthly</option><option value="Option 2">Option 2 : $15.00 USD - monthly</option><option value="Option 3">Option 3 : $25.00 USD - monthly</option><option value="Option 4">Option 4 : $50.00 USD - monthly</option><option value="Option 5">Option 5 : $100.00 USD - monthly</option></select></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<input type="hidden" name="currency_code" value="USD" />\r\n<input type="image" alt="PayPal - The safer, easier way to pay online!" name="submit" src="https://www.paypalobjects.com/en_US/i/btn/btn_subscribeCC_LG.gif" />\r\n<img alt="" src="https://www.paypalobjects.com/en_US/i/scr/pixel.gif" width="1" height="1" />\r\n\r\n</form></div>\r\nBy making a recurring contribution, I acknowledge that the amount I have selected above will be charged to my credit card on the 15th of every month. You may cancel at any time. The first charge will be made immediately.\r\n\r\n<strong>Contributions or gifts to The Colored Rocks Foundation are tax deductible.</strong> Please make a donation today. If you can''t make a monetary donation, please scroll down and select another way to help. We have many ways you can get involved! [si-contact-form form=''2'']', 'Donate', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2014-08-16 14:20:27', '2014-08-16 14:20:27', '', 7, 'http://coloredrocks.org/7-revision-v1/', 0, 'revision', '', 0),
