(440, 1, '2014-08-16 14:37:44', '2014-08-16 14:37:44', 'Pictured above: recipients of the 2013 Colored Rocks Prize – awarded to distinguished Sr. male students of color at GA high schools. From left: Jed Paz, Joseph Hooper, JaCorvis Cobbs, Greg Barber, Austin Green, B. Washington, Rashaud Archie, Isaiah Matthews, Donnie Pulliam, Tony Jones, Kalif Jones, Alex Grady, Shaun Verma, Kennington Smith, Rashad Goodson. (not pictured: Joseph Cobb)\r\n<h1 style="text-align: center;"><span style="color: #99cc00;">Stories of 2013 Winners at <a title="Colored Rocks'' Stories" href="http://www.facebook.com/ColoredRocks" target="_blank">Facebook.com/ColoredRocks</a> </span></h1>\r\n<h1 style="text-align: center;"><span style="color: #99cc00;"> <span style="color: #ffcc00;"><strong>2014</strong> Competition Is Now Open - Entry Deadline <del></del><span style="color: #33cccc;">1/6/14</span></span></span></h1>\r\n<p style="text-align: center;"><img alt="Colored Rocks" src="http://coloredrocks.org/wp-content/uploads/blocks.png" usemap="#m_blocks" width="670" height="229" /></p>\r\n<map id="m_blocks" name="m_blocks"> <area title="Register" alt="Register" coords="457,9,670,229" shape="rect" href="http://coloredrocks.org/wp-login.php?action=register" /> <area title="What is the question" alt="What is the question" coords="229,9,442,229" shape="rect" href="/question" /> <area title="About Colored Rocks" alt="About Colored Rocks" coords="0,9,213,229" shape="rect" href="/about" /> </map>\r\n\r\nAlmost <strong>one out of three young men of color do not graduate from Georgia high schools.</strong> In fact, Georgia suffers as one of 5 states with the worst high school graduation rates in the country. On the other hand, there are male students of color who do extremely well. Remember their faces. Remember their names. For they are using their talent to inspire and mold younger students. They are our future movers and shakers. They are known as Colored Rocks.\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-53" title="2013-prize-winners" alt="" src="http://coloredrocks.org/wp-content/uploads/2012-prize-winners.jpg" width="670" height="366" /></p>', 'Home_Bak', '', 'inherit', 'closed', 'closed', '', '435-revision-v1', '', '', '2014-08-16 14:37:44', '2014-08-16 14:37:44', '', 435, 'http://coloredrocks.org/435-revision-v1/', 0, 'revision', '', 0),
(441, 1, '2014-08-17 06:02:59', '2014-08-17 06:02:59', 'To submit essay and project plan, <a href="http://coloredrocks.org/wp-login.php?action=register">create an account</a> and sign in.\r\n\r\nAgree to the rules by placing a checkmark in the box.\r\n\r\nNo html tags allowed due to security reasons.\r\n\r\n<strong><span style="text-decoration: underline;">Rules governing the Colored Rocks Prize</span></strong>:\r\n<ol>\r\n	<li>The Colored Rocks Foundation (CRF) will hold an essay contest. 15 prizes will be awarded (1- $3,500 prize, 1 - $750 prize, 1 - $150 prize, 12 - $50 prizes). Winners will receive their prize in the form of a check and may use their prize money for any purpose they desire. The prize money may – but does not have to – be used for tuition or fees at any college or institute of higher learning.</li>\r\n	<li>Prize awards will be delivered directly to the winning applicants. Winning applicants are responsible for any applicable taxes.</li>\r\n	<li>CRF, in its sole and absolute discretion, will choose the winners of this competition based upon its subjective determination as to the participants submitting the most compelling answer to the posed question (see 4. below), along with the best laid plan for their community project as determined by CRF in its sole and absolute discretion.</li>\r\n	<li>The essay and community/peer project plan must answer the following 2-part question: PART 1.What specifically is it about you that makes you a "Colored Rock" and how do you see yourself as a positive influence to other young men of color who need support, guidance and intervention as they face personal, academic or social challenges? PART 2. How will you personally make an impact as a <em>‘colored rock’</em> among younger students at the middle school or elementary school levels? (By lending a helping hand to another student(s) of color who may be struggling or who needs inspiration and guidance, what can you do to help him (them) move closer to his (their) potential to be a "Colored Rock"?) Winners must execute and complete the project described and outlined in their answer prior to receiving their high school diploma, so please think carefully about your specific plan. Be sure to answer both questions.</li>\r\n	<li>Along with submitting an essay answer and community project plan for the competition, each participant is required to register on the CRF website, providing all information requested, including applicant’s name, address, telephone number, email address, user name, password, high school name, address and phone number, and gender and ethnicity.</li>\r\n	<li>All entries must be submitted at Coloredrocks.org between August 20, 2014 and December 6, 2014 and must be at least 500 but less than 1000 words (one to two pages) combined for the essay answer and community project plan.</li>\r\n	<li>Answers must be submitted in English. Only written (and not oral) answers will be accepted for this competition.</li>\r\n	<li>Persons without access to a personal computer or may submit entries at a public library using the library’s computer.</li>\r\n	<li>Participants must be high school seniors at the time of their submitted application and on track to graduate with the class of 2015. In the event a participant is selected as a contest winner and does not complete his community project or graduate from high school by June 2015, the winner(s) will forfeit his winner status and any expected prizes hereby.</li>\r\n	<li>Participants and Honorees must attend and graduate from a high school in Georgia to be eligible for the award.</li>\r\n	<li>All applicants expressly agree to authorize CRF to publicly announce the winners and to allow CRF to use the winners’ name and likeness for publicity purposes in press releases, publications, calendars (or other items - some for sale), online and any other media or non-media promotions. Winners will be expected to submit a photograph or submit to be photographed for this purpose.</li>\r\n	<li>All honorees are expected to attend a Media Day gathering, usually held in Atlanta.</li>\r\n	<li>CRF in its sole and absolute discretion may publish or disseminate any essay, or pull quotes from any essay submitted to the competition (with credit due to its author) through any medium of its choosing, including posting the essay on its website, calendar (or other items which may be distributed or sold in conjunction with CRF fundraising with no proceeds, royalties or payments of any kind due to participants), marketing efforts or media promotions.</li>\r\n	<li>The winners of the competition will be notified in February 2014. All prizes will be awarded to the selected winners upon proof of completion of their community project and receipt of their high school diploma. Proof of high school graduation and project completion must be submitted to CRF prior to winners receiving their award.</li>\r\n	<li>Officers, Directors and Employees of CRF (and their immediate family members living in the same household) are not eligible to participate.</li>\r\n	<li>CRF shall be the final judge as to compliance with the rules and conditions of the competition. Neither CRF, nor its Officers, Directors, Employees nor Partners assume any liability whatsoever for any property loss or other damages in connection with the competition and participants agree to hold harmless CRF, its Officers, Directors, Employees and Partners.</li>\r\n	<li>Participants expressly agree to convey, assign, release and transfer all rights and interests in their essay and community project plan submitted for the competition, including any and all intellectual property rights concerning the essay and plan, to and for the sole and exclusive benefit of CRF as of the date such intellectual property is submitted and for all times thereafter for any and all purposes. CRF reserves all rights to publish and disseminate any essay answer and community project plan submitted for the competition in part and/or in its entirety for any purpose whatsoever, including but not limited to using such intellectual property for marketing, media, promotions and sales.</li>\r\n	<li>No entry fee, payment or proof of purchase is required, nor will any entry fee, payment or proof of purchase be accepted by CRF from any applicant.</li>\r\n	<li>Only one essay answer and community/peer project plan submission is allowed per person.</li>\r\n	<li>After hitting the “submit” button, competition entry is final and may not be amended or resubmitted.</li>\r\n	<li>Competition Void where prohibited by law.</li>\r\n	<li>Competition rules subject to changes, errors and omissions.</li>\r\n</ol>', 'Contest Rules', '', 'inherit', 'closed', 'closed', '', '57-revision-v1', '', '', '2014-08-17 06:02:59', '2014-08-17 06:02:59', '', 57, 'http://coloredrocks.org/57-revision-v1/', 0, 'revision', '', 0),
(442, 1, '2015-07-07 22:23:33', '2015-07-07 22:23:33', 'Members of the Media may contact the Colored Rocks Foundation <a title="Contact" href="http://coloredrocks.org/contact/">from here.</a>\n\n<a title="Meet the Top 3 Recipients of the 2015 Colored Rocks Prize" href="http://www.prlog.org/12473069-philanthropy-faith-influence-get-georgia-student-presidents-top-honors.html">Meet the Top 3 Recipients of the 2015 Colored Rocks Prize</a>\n\nSavannah''s Nick Carter Heads 2014 Colored Rocks Class for Inspiring Students to Read and be Responsible\n\nhttp://www.prlog.org/12473069-philanthropy-faith-influence-get-georgia-student-presidents-top-honors.html\n\nhttp://patch.com/georgia/decatur/15-seniors-be-tabbed-2015-colored-rocks-honor\n\n<a href="http://atlantadailyworld.com/2012/10/19/unique-wall-calendar-features-success-advice-from-unlikely-youth/" target="_blank">Unique Wall Calendar Features Success Advice from Unlikely Youth</a>\n\n<a href="http://www.24-7pressrelease.com/press-release/the-colored-rocks-prize-competition-cheryl-dukes-will-discuss-it-all-on-cbs-atlanta-232766.php" target="_blank">The Colored Rocks Prize Competition - Cheryl Dukes Will discuss it All on CBS Atlanta</a>\n\n<a href="http://patch.com/georgia/alpharetta/an--milton-highs-shaun-verma-among-2013-colored-rocks32563c7624#.U_BG7kBn3i5" target="_blank">Milton High''s Shaun Verma Among 2013 Colored Rocks Prize Winners</a>\n\n<a href="http://mundohispanico.com/news/2013/jan/09/galardonan-dreamer-de-georgia/" target="_blank">Galardonan a ‘dreamer’ de Georgia</a>\n\n<a href="http://patch.com/georgia/hollysprings/an--2013-colored-rocks-prize-winners-announced-155762e7#.U_BHBEBn3i5" target="_blank">2013 Colored Rocks Prize Winners Announced</a>\n\n<a href="http://www.atlantatribune.com/2013/06/19/georgia-colleges-still-on-the-minds-of-colored-rocks-recipients/" target="_blank">Georgia Colleges Still on the Minds of Colored Rocks Recipients</a>\n\n&nbsp;\n<blockquote>\n<div>"We had the pleasure of photographing the award winners for the Colored Rocks Foundation . . . It was truly an honor to photograph this talented group of high school seniors. These young men are not only brilliant, but they are humble and polite, excited and energetic . . . and so ready to make their mark on the world. To the 2012 Colored Rocks: We are in awe of you and we wish each one of you the very best! - Carmen and Jim McCarty, <a title="http://www.atlantaphotostudio.com/" href="http://www.atlantaphotostudio.com/">www.AtlantaPhotoStudio.com</a></div></blockquote>\n<div></div>\n<blockquote>\n<div>"It''s wonderful to see an organization which is working to intervene early in the lives of young men." - John Leonard, Senior Vice President, Better World Advertising</div></blockquote>\n&nbsp;', 'Press', '', 'inherit', 'closed', 'closed', '', '50-autosave-v1', '', '', '2015-07-07 22:23:33', '2015-07-07 22:23:33', '', 50, 'http://coloredrocks.org/50-autosave-v1/', 0, 'revision', '', 0),
