(463, 1, '2014-08-17 10:47:46', '2014-08-17 10:47:46', 'Pictured above: recipients of the 2014 Colored Rocks Prize - awarded to high-achieving senior male students from diverse ethnic backgrounds at Georgia high schools. Clockwise from mid-bottom: Charles Orgbon III, Jose Fragoso, Kyle Likely, Miguel Arroyo, Keith Crawford, Troy Ashe, Abel Belete, Qualon Bobbitt, Aaron Brown, Tosin Olagunju, Nick Carter, James Brannon.\r\n<h1 style="text-align: center;"><span style="color: #99cc00;">Stories of 2014 Winners at <a title="Colored Rocks'' Stories" href="http://www.facebook.com/ColoredRocks" target="_blank">Facebook.com/ColoredRocks</a> </span></h1>\r\n<h1 style="text-align: center;"><span style="color: #99cc00;"> <span style="color: #ffcc00;"><strong>2015</strong> Competition Is Now Open - Entry Deadline <del></del><span style="color: #33cccc;">12/6/14</span></span></span></h1>\r\n<p style="text-align: center;"><img alt="Colored Rocks" src="http://coloredrocks.org/wp-content/uploads/blocks.png" usemap="#m_blocks" width="670" height="229" /></p>\r\n<map id="m_blocks" name="m_blocks"> <area title="Register" alt="Register" coords="457,9,670,229" shape="rect" href="http://coloredrocks.org/wp-login.php?action=register" /> <area title="What is the question" alt="What is the question" coords="229,9,442,229" shape="rect" href="/question" /> <area title="About Colored Rocks" alt="About Colored Rocks" coords="0,9,213,229" shape="rect" href="/about" /> </map>\r\n\r\nAlmost <strong>one out of three young men of color do not graduate from Georgia high schools.</strong> In fact, Georgia suffers as one of 5 states with the worst high school graduation rates in the country. On the other hand, there are male students of color who do extremely well. Remember their faces. Remember their names. For they are using their talent to inspire and mold younger students. They are our future movers and shakers. They are known as Colored Rocks.\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-53" title="2013-prize-winners" alt="" src="http://coloredrocks.org/wp-content/uploads/2012-prize-winners.jpg" width="670" height="366" /></p>', 'Home Of The Colored Rocks Prize', '', 'inherit', 'closed', 'closed', '', '5-revision-v1', '', '', '2014-08-17 10:47:46', '2014-08-17 10:47:46', '', 5, 'http://coloredrocks.org/5-revision-v1/', 0, 'revision', '', 0),
