(470, 1, '2014-08-17 17:15:26', '2014-08-17 17:15:26', 'CHANGE is what we need to keep identifying and recognizing Colored Rocks in Georgia AND to keep these Colored Rocks inspiring their younger peers and working with them to improve Georgia’s high school graduation rate.\r\n\r\nCan you spare a little CHANGE?\r\n<div align="center">\r\n<h1 class="entry-title">Option 1</h1>\r\n<form action="https://www.paypal.com/cgi-bin/webscr" method="post"><input type="hidden" name="cmd" value="_s-xclick" />\r\n<input type="hidden" name="hosted_button_id" value="CTVBZ8MCBQY3G" />\r\n<input type="image" alt="PayPal - The safer, easier way to pay online!" name="submit" src="http://coloredrocks.org/wp-content/uploads/change1.png" />\r\n<img alt="" src="https://www.paypalobjects.com/en_US/i/scr/pixel.gif" width="1" height="1" border="0" /></form></div>\r\n<div style="border-bottom: 1px solid #EEE;" align="center">\r\n<h1 class="entry-title">Option 2</h1>\r\n<form action="https://www.paypal.com/cgi-bin/webscr" method="post"><input type="hidden" name="cmd" value="_s-xclick" />\r\n<input type="hidden" name="hosted_button_id" value="Y2HXJPVNZMXA8" />\r\n<table width="288">\r\n<tbody>\r\n<tr>\r\n<td><input type="hidden" name="on0" value="Monthly Donation Amount" />Monthly Donation Amount</td>\r\n</tr>\r\n<tr>\r\n<td><select name="os0"><option value="Option 1">Option 1 : $10.00 USD - monthly</option><option value="Option 2">Option 2 : $15.00 USD - monthly</option><option value="Option 3">Option 3 : $25.00 USD - monthly</option><option value="Option 4">Option 4 : $50.00 USD - monthly</option><option value="Option 5">Option 5 : $100.00 USD - monthly</option></select></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;"><input type="hidden" name="currency_code" value="USD" />\r\n<input type="image" alt="PayPal - The safer, easier way to pay online!" name="submit" src="http://coloredrocks.org/wp-content/uploads/change2.png" />\r\n<img alt="" src="https://www.paypalobjects.com/en_US/i/scr/pixel.gif" width="1" height="1" /></p>\r\n\r\n</form>By making a recurring contribution, I acknowledge that the amount I have selected above will be charged to my credit card on the 15th of every month. You may cancel at any time. The first charge will be made immediately.\r\n\r\n</div>\r\n<strong>Contributions or gifts to The Colored Rocks Foundation are tax deductible.</strong> Please make a donation today. If you can''t make a monetary donation, please scroll down and select another way to help. We have many ways you can get involved! [si-contact-form form=''2'']', 'CHANGE', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2014-08-17 17:15:26', '2014-08-17 17:15:26', '', 7, 'http://coloredrocks.org/7-revision-v1/', 0, 'revision', '', 0),
