ect completion must be submitted to CRF prior to winners receiving their award.</li>\r\n	<li>Officers, Directors and Employees of CRF (and their immediate family members living in the same household) are not eligible to participate.</li>\r\n	<li>CRF shall be the final judge as to compliance with the rules and conditions of the competition. Neither CRF, nor its Officers, Directors, Employees nor Partners assume any liability whatsoever for any property loss or other damages in connection with the competition and participants agree to hold harmless CRF, its Officers, Directors, Employees and Partners.</li>\r\n	<li>Participants expressly agree to convey, assign, release and transfer all rights and interests in their essay and community project plan submitted for the competition, including any and all intellectual property rights concerning the essay and plan, to and for the sole and exclusive benefit of CRF as of the date such intellectual property is submitted and for all times thereafter for any and all purposes. CRF reserves all rights to publish and disseminate any essay answer and community project plan submitted for the competition in part and/or in its entirety for any purpose whatsoever, including but not limited to using such intellectual property for marketing, media, promotions and sales.</li>\r\n	<li>No entry fee, payment or proof of purchase is required.</li>\r\n	<li>Only one essay answer and community/peer project plan submission is allowed per person.</li>\r\n	<li>After hitting the “submit” button, competition entry is final and may not be amended or resubmitted.</li>\r\n	<li>Competition Void where prohibited by law.</li>\r\n	<li>Competition rules subject to changes, errors and omissions.</li>\r\n</ol>', 'What is the 2015 question?', '', 'inherit', 'closed', 'closed', '', '150-revision-v1', '', '', '2014-08-18 06:59:43', '2014-08-18 06:59:43', '', 150, 'http://coloredrocks.org/150-revision-v1/', 0, 'revision', '', 0),
(475, 1, '2014-08-18 07:01:44', '2014-08-18 07:01:44', 'All Prize Applicants must answer the following 2-part question to be considered for the 2015 Colored Rocks Prize:\r\n<h3 style="text-align: center;"><strong>PART 1. </strong></h3>\r\n<h3 style="text-align: center;"><strong></strong>What specifically is it about you that makes you a "Colored Rock" and how do you see yourself as a positive influence to other young men of color who need support, guidance and intervention as they face personal, academic or social challenges?</h3>\r\n<p style="text-align: center;"><strong>AND </strong></p>\r\n\r\n<h3 style="text-align: center;"><strong>PART 2. </strong></h3>\r\n<h3 style="text-align: center;"><strong>How will you personally make an impact as a <em>‘Colored <span style="color: #ff0000;">R</span><span style="color: #ffff00;">o</span><span style="color: #ccffcc;">c</span>k’</em> among younger students at the middle school or elementary school levels?</strong> (By lending a helping hand to another student(s) of color who may be struggling or who needs inspiration, what will you do to help him excel and move closer to his potential to be a "Colored Rock"?)                                            <span style="color: #ffff00;"><strong>Please note:</strong> Winners must execute and complete the project described and outlined in their answer prior to receiving their high school diploma, so please think carefully about your specific plan.</span> <span style="color: #ffff00;">Be sure to answer both questions prior to submitting your entry.</span></h3>\r\nTo submit essay and project plan, <a href="http://coloredrocks.org/wp-login.php?action=register">create an account</a> and sign in.\r\n\r\nAgree to the rules by placing a checkmark in the box.\r\n\r\nNo html tags allowed due to security reasons.\r\n\r\n<strong><span style="text-decoration: underline;">Rules governing the Colored Rocks Prize</span></strong>:\r\n<ol>\r\n	<li>The Colored Rocks Foundation (CRF) will hold an essay contest. 15 prizes will be awarded (1- $3,500 prize, 1 - $750 prize, 1 - $150 prize, 12 - $50 prizes). Winners will receive their prize in the form of a check and may use their prize money for any purpose they desire. The prize money may – but does not have to – be used for tuition or fees at any college or institute of higher learning.</li>\r\n	<li>Prize awards will be delivered directly to the winning applicants. Winning applicants are responsible for any applicable taxes.</li>\r\n	<li>CRF, in its sole and absolute discretion, will choose the winners of this competition based upon its subjective determination as to the participants submitting the most compelling answer to the posed question (see 4. below), along with the best laid plan for their community/peer project as determined by CRF in its sole and absolute discretion.</li>\r\n	<li>The essay and community project plan must answer the 2-part question: 1.Who are you, what specifically is it about you that makes you a "Colored Rock", and how do you see yourself as a positive influence to other young men of color who need support, guidance and intervention as they face personal, academic or social challenges? AND 2. How will you personally make an impact as a <em>‘colored rock’</em> among your peers? (By lending a helping hand to another young man -- or men -- of color who may be struggling, what can you do to help him move closer to his potential to be a "Colored Rock"?) Winners must execute and complete the peer project described and outlined in their answer, so please think carefully about your specific plan. Be sure to answer both questions.</li>\r\n	<li>Along with submitting an essay answer and community project plan for the competition, each participant is required to register on the CRF website, providing all information requested, including applicant’s name, address, telephone number, email address, user name, password, high school name and address and phone number,  gender and ethnicity.</li>\r\n	<li>All entries must be submitted at CRF.org between August 20, 2014 and December 6, 2014, and must be less than 1000 words combined for the essay answer and community project plan.</li>\r\n	<li>Answers must be submitted in English. Only written (and not oral) answers will be accepted for this competition.</li>\r\n	<li>Persons without access to a personal computer or email address may submit entries at a public library using the library’s computer.</li>\r\n	<li>Participants must be high school seniors at the time of their submitted application and on track to graduate with the class of 2013. In the event a participant is selected as a contest winner and does not complete his community project or graduate from high school by June 2015, the winner(s) will forfeit his winner status and any expected prizes hereby.</li>\r\n	<li>Participants must attend and winners must graduate from a high school in Georgia to be eligible for the award.</li>\r\n	<li>All applicants expressly agree to authorize CRF to publicly announce the winners and to allow CRF to use the winners’ name and likeness for publicity purposes in press releases, publications, calendars (some for sale), online and any other media or non-media promotions. Winners will be expected to submit a photograph for this purpose.</li>\r\n	<li>CRF in its sole and absolute discretion may publish or disseminate any essay, or pull quotes from any essay submitted from the competition (with credit due to its author) through any medium of its choosing, including posting the essay on its website, calendar (which may be sold in conjunction with CRF fundraising with no proceeds, royalties or payments of any kind due to participants), marketing efforts or media promotions.</li>\r\n	<li>The winners of the competition will be notified in February 2015. All prizes will be awarded to the selected winners upon proof of completion of their community project and receipt of their high school diploma. Proof of high school graduation and project completion must be submitted to CRF prior to winners receiving their award.</li>\r\n	<li>Officers, Directors and Employees of CRF (and their immediate family members living in the same household) are not eligible to participate.</li>\r\n	<li>CRF shall be the final judge as to compliance with the rules and conditions of the competition. Neither CRF, nor its Officers, Directors, Employees nor Partners assume any liability whatsoever for any property loss or other damages in connection with the competition and participants agree to hold harmless CRF, its Officers, Directors, Employees and Partners.</li>\r\n	<li>Participants expressly agree to convey, assign, release and transfer all rights and interests in their essay and community project plan submitted for the competition, including any and all intellectual property rights concerning the essay and plan, to and for the sole and exclusive benefit of CRF as of the date such intellectual property is submitted and for all times thereafter for any and all purposes. CRF reserves all rights to publish and disseminate any essay answer and community project plan submitted for the competition in part and/or in its entirety for any purpose whatsoever, including but not limited to using such intellectual property for marketing, media, promotions and sales.</li>\r\n	<li>No entry fee, payment or proof of purchase is required.</li>\r\n	<li>Only one essay answer and community/peer project plan submission is allowed per person.</li>\r\n	<li>After hitting the “submit” button, competition entry is final and may not be amended or resubmitted.</li>\r\n	<li>Competition Void where prohibited by law.</li>\r\n	<li>Competition rules subject to changes, errors and omissions.</li>\r\n</ol>', 'What is the 2015 question?', '', 'inherit', 'closed', 'closed', '', '150-revision-v1', '', '', '2014-08-18 07:01:44', '2014-08-18 07:01:44', '', 150, 'http://coloredrocks.org/150-revision-v1/', 0, 'revision', '', 0),
