(828, 1, '2015-07-07 01:15:27', '2015-07-07 01:15:27', 'Philanthropy, Faith, Influence Get Georgia Student Presidents Top Honors \r\nThree recent Georgia High School Graduates, All Former Student Council Presidents, Used Their Faith, Philanthropy and Influence To Win Top Honors in the 2015 Colored Rocks Prize Competition. Meet the Top 3 Here.\r\n\r\n\r\n', 'Meet the Top 3 Winners of the 2015 Colored Rocks Prize', 'Meet the Top 3 Winners of the 2015 Colored Rocks Prize', 'inherit', 'closed', 'closed', '', 'crf-top-winners-release-2015', '', '', '2015-07-07 01:23:11', '2015-07-07 01:23:11', '', 0, 'http://coloredrocks.org/wp-content/uploads/CRF-top-winners-release-2015.pdf', 0, 'attachment', 'application/pdf', 0),
